// classes



class Paddle {
  constructor(x, y, w) {
    this.xPos=x
    this.yPos=y
    this.width=w
  }

  draw() {
    for (let i=this.yPos*feature.screenWidth*3+this.xPos*3; i<this.yPos*feature.screenWidth*3+(this.xPos+this.width)*3+3; i ++) {
      feature.screen[i]=255
    }
  }





  update(){
    if(moving==true){

      //wall detection variable reset
      wall2left=false
      wall2right=false
      wall2up=false
      wall2down=false

      if(direction=="left"){
        next_x=this.xPos-1
        if(next_x<0){
          next_x=next_x+feature.screenWidth
        }
        next_y=this.yPos
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
            wall2left=true
          }
        }
        if(wall2left==false){
          this.xPos=next_x
          draw()
        }
      }else if(direction=="right"){
        next_x=(this.xPos+1)%feature.screenWidth
        next_y=this.yPos
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
              wall2right=true
           }
        }
        if(wall2right==false){
          this.xPos=next_x
          draw()
        }
      }else if(direction=="up"){
        next_x=this.xPos
        next_y=this.yPos-1
        if(next_y<0){
          next_y=next_y+feature.screenHeight
        }
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
              wall2up=true
           }
        }
        if(wall2up==false){
          this.yPos=next_y
          draw()
        }
      }else if(direction=="down"){
        next_x=this.xPos
        next_y=(this.yPos+1)%feature.screenHeight
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
              wall2down=true
           }
        }
        if(wall2down==false){
          this.yPos=next_y
          draw()
        }
      }






    }
  }







}



class Wall {
  constructor(x, y, w, h) {
    this.x=x
    this.y=y
    this.width=w
    this.height=h
  }

  draw() {
    // horizontal lines
    for (let i=0; i<this.width; i++) {
      feature.screen[this.y*feature.screenWidth*3+(this.x+i)*3]=255
      feature.screen[(this.y+this.height-1)*feature.screenWidth*3+(this.x+i)*3]=255
    }

    // vertical lines
    for (let i=0; i<this.height; i++) {
      feature.screen[(this.y+i)*feature.screenWidth*3+this.x*3]=255
      feature.screen[(this.y+i)*feature.screenWidth*3+(this.x+this.width-1)*3]=255
    }
  }
}

