function initialize_timer(){
  if(timer_initialized==false){
    timer_initialized=true
    setInterval(()=>{
      let unita_char=""+units
      let time_fraction=unita_char.slice(unita_char.length-3,unita_char.length-2) 
      if(time_fraction==""){
        time_fraction="0"
      }
      let display_time_text=new Date(units).toISOString().substr(11, 8);
      display_time_text=display_time_text+"."+time_fraction
      time_display.set({'text':display_time_text})
      if(timer_on==true){
        units=units+timer_delta
      }
    },timer_delta)
  }
}

