function ball_dirction_up(){
  ball_direction=ball_direction+1
  if(ball_direction==8){
    ball_direction=0
  }
  console.log('ball_direction: '+ball_direction);
}
function ball_dirction_down(){
  ball_direction=ball_direction-1
  if(ball_direction==-1){
    ball_direction=7
  }
  console.log('ball_direction: '+ball_direction);
}

function rotate_ball_left_side_kick(){
    ball.rotation.y=ball.rotation.y+kick_spin
    ball_dirction_up()
}
function rotate_ball_right_side_kick(){
    ball.rotation.y=ball.rotation.y-kick_spin
    ball_dirction_down()
}
function move_ball_north(){
    ball.position.z=ball.position.z+kick_distance  
}
function move_ball_south(){
    ball.position.z=ball.position.z-kick_distance  
}
function move_ball_east(){
    ball.position.x=ball.position.x+kick_distance  
}
function move_ball_west(){
    ball.position.x=ball.position.x-kick_distance  
}







