function update(){

  if(screen=="level01"){
    check4completion()
  }



  if(screen=="base"){
    draw_base()
  }else if(screen=="level01"){
    paddle.update()
    //update bananas
    for(let i=0; i<bananas.length; i++){
      bananas[i].update()
    }
    draw_level01()
  }else if(screen="end"){
    draw_end()


  }
}


function check4completion(){
  //check if all bananas delivered
  if(n_bananas==bananas.length){
    //check if all bananas in one house
    for(let i=0; i<house_bananas.length; i++){
      bananas_in_house=house_bananas[i]
      if(bananas_in_house==bananas.length){
        game_passed=true
        pass_type="greedy ape"
      }
    }
    //check if each house has at least one banana
    if(game_passed==false){
      let sharing_ape=true
      for(let i=0; i<house_bananas.length; i++){
        bananas_in_house=house_bananas[i]
        if(bananas_in_house<1){
          sharing_ape=false
        }
      }
      if(sharing_ape==true){
        game_passed=true
        pass_type="sharing ape"
      }
    }
  }
  if(game_passed==true){
    screen="end"
  }
}


