function draw_level01() {
  feature.screen.fill()
  //draw score
  draw_score()

  //draw paddle
  paddle.draw()

  //draw walls
  for(let i=0; i<walls.length; i++){
    walls[i].draw()
  }
  //draw bananas
  for(let i=0; i<bananas.length; i++){
    bananas[i].draw()
  }
}

function draw_score(){
  //get number of bananas inside houses 
  n_bananas=0
  for(let i=0; i<bananas.length; i++){
    if(bananas[i].in_house==true){
      n_bananas=n_bananas+1
    }
  }
  //draw score somewhere
  setDrawColorRGBA(255, 255, 255)
  drawChar_shapes(n_bananas,55,38)

  //count bananas in each house

  house_bananas=[]
  for(let i=0; i<houses.length; i++){
    let house2check=houses[i]
    let n_house_bananas=0
    for(let j=0; j<bananas.length; j++){
      let banana2check=bananas[j]
      if(banana2check.picked_up==false && banana2check.in_house==true){
        if(banana2check.x>=house2check.x+2 && banana2check.x<=house2check.x+house2check.w-2){
          if(banana2check.y<=house2check.y-1 && banana2check.y>=house2check.y+house2check.h+2){
            n_house_bananas=n_house_bananas+1
          }
        }
      }
    }
    house_bananas.push(n_house_bananas)
    //draw score somewhere
    setDrawColorRGBA(55, 55, 55)
    drawChar_shapes(n_house_bananas,house2check.x+3,house2check.y-2)


  }


}


